import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const initialShot = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: initialShot });
    screenshots.push(initialShot);

    // Wait for the sort dropdown using label text and fallback to select[for]
    // Try to locate the "Sort by:" label and its associated select
    const sortLabel = await page.waitForSelector('text=Sort by:', { timeout: 5000 });
    // Get the select element that follows the label
    const sortSelect = await sortLabel.evaluateHandle(label => {
      // Find the select element next to the label
      let el = label.nextElementSibling;
      while (el && el.tagName !== 'SELECT') el = el.nextElementSibling;
      return el;
    });
    // If not found, fallback to select#sortSelect
    let selectHandle = sortSelect;
    if (!selectHandle) {
      selectHandle = await page.$('select#sortSelect');
    }

    // Select "Price: Low to High" option (value="price-low")
    await page.selectOption('select#sortSelect', 'price-low');

    // Wait for the products grid/list to update
    await page.waitForSelector('.products-grid, .products-list', { timeout: 5000 });

    // Take screenshot after sort applied
    const sortShot = path.join(screenshotsDir, 'step_2_price_sort_applied.png');
    await page.screenshot({ path: sortShot });
    screenshots.push(sortShot);

    // Extract the titles and prices of the first 3 products to verify sort
    const productCards = await page.$$('.products-grid .product-card, .products-list .product-card-list');
    const extractedData = { products: [] };
    for (let i = 0; i < Math.min(3, productCards.length); i++) {
      const title = await productCards[i].$eval('.product-title', el => el.textContent.trim());
      const price = await productCards[i].$eval('.product-price', el => {
        // Extract the first number after $
        const match = el.textContent.match(/\$([0-9.,]+)/);
        return match ? match[1] : null;
      });
      extractedData.products.push({ title, price });
    }

    return {
      success: true,
      action: "Applied 'Price: Low to High' sort filter and extracted product data",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
